import React from "react";

let date = new Date()
let greeting = "";

if (date >0 && date <12) {
  greeting = "Good Morning" ;
} else if (date >=12 && date <=19){
  greeting ="Good Evening";
} else greeting = "Good Night";

const App =() => {
  return(
    <div>
      <h1> {date} </h1>
      <h1>Welcome sir, {greeting} </h1>
    </div>

  )
};

export default App;
